import { Component, OnInit } from '@angular/core';
import { Aluno } from './models/aluno.model';
import { AlunosService } from './services/alunos.service';

@Component({
  selector: 'app-alunos',
  templateUrl: './alunos.component.html',
  styleUrls: ['./alunos.component.css']
})
export class AlunosComponent implements OnInit {
  alunos: Aluno[] = [];
  novoAluno: Aluno = {
    nome: '',
    email: '',
    sexo: '',
    dataNascimento: ''
  };

  constructor(private alunosService: AlunosService) { }

  ngOnInit(): void {
    this.alunos = this.alunosService.getAlunos();
  }

  adicionarAluno(): void {
    this.alunosService.addAluno(this.novoAluno);
    this.novoAluno = {
      nome: '',
      email: '',
      sexo: '',
      dataNascimento: ''
    };
  }

  atualizarAluno(aluno: Aluno): void {
    this.alunosService.updateAluno(aluno);
  }

  excluirAluno(email: string): void {
    this.alunosService.deleteAluno(email);
  }
}
<h2>Lista de Alunos</h2>

<table>
  <thead>
    <tr>
      <th>Nome</th>
      <th>Email</th>
      <th>Sexo</th>
      <th>Data de Nascimento</th>
      <th>Ações</th>
    </tr>
  </thead>
  <tbody>
    <tr *ngFor="let aluno of alunos">
      <td><input [(ngModel)]="aluno.nome" [disabled]="aluno.editing" /></td>
      <td><input [(ngModel)]="aluno.email" [disabled]="aluno.editing" /></td>
      <td><input [(ngModel)]="aluno.sexo" [disabled]="aluno.editing" /></td>
      <td><input [(ngModel)]="aluno.dataNascimento" [disabled]="aluno.editing" /></td>
      <td>
        <button (click)="aluno.editing = !aluno.editing" [disabled]="aluno.editing">Editar</button>
        <button (click)="atualizarAluno(aluno)" [disabled]="!aluno.editing">Salvar</button>
        <button (click)="excluirAluno(aluno.email)">Excluir</button>
      </td>
    </tr>
  </tbody>
</table>

<h2>Adicionar Aluno</h2>

<div>
  <label>Nome:</label>
  <input [(ngModel)]="novoAluno.nome" />
</div>
<div>
  <label>Email:</label>
  <input [(ngModel)]="novoAluno.email" />
</div>
<div>
  <label>Sexo:</label>
  <input [(ngModel)]="novoAluno.sexo" />
</div>
<div>
  <label>Data de Nascimento:</label>
  <input [(ngModel)]="novoAluno.dataNascimento" />
</div>
<div>
  <button (click)="adicionarAluno()">Adicionar</button>
</div>
